import React from 'react';
import { Link } from 'react-router-dom';


function Header() {
  return (
    <header className="header">
    <div className="header__logo" />
    <Link to="sign-in" className="header__link header__link_login">Войти</Link>
    </header>
  );
}

export default Header;
